import React, { Component } from 'react';

class FilterBar extends Component {
  constructor(props) {
    super(props);

    this.state = {
      filter: 'all',
    }
  }

  render() {
    return (
      <div class="row">
        <div class="col s12 m6">
          <div class="card blue-grey darken-1">
            <div class="card-content white-text">
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default FilterBar;
